import React from 'react';
import ReactDOM from 'react-dom';
import { ByteProvider } from "./context/bytes";
import App from './App';
import './index.css';
import { CartProvider } from './context/cart';

ReactDOM.render(
  <ByteProvider>
    <CartProvider>
      <UserProvider>
      <React.StrictMode>
        <App />
      </React.StrictMode>
      </UserProvider>
    </CartProvider>
  </ByteProvider>,
  document.getElementById('root')
);
